import React from 'react';
import s from './Button.module.css'



type ButtonType = {
    name:string
    started:()=>void
    filter?:string
}


export const Button = (props:ButtonType) => {

    const  Started=()=> {
        props.started()
    }
    return (
<span className={props.filter === props.name ? s.buttonStyle:''}>
    <button  onClick={Started}> {props.name}</button>
</span>



    );
};
